import React, { FC } from 'react';

interface IProps {
  type: string,
  label: string,
  isButtonDisabled?: boolean
}

const Button:React.FC<IProps> = (props: any) => {
  return(
    <button className="button" name="button" type="button">
     {props.label}
    </button>
  );
}

export default Button;
